import styled from 'styled-components';
import HomeContainer, { Container, HomeLabel, Linkk, Name, Name2, NavBar, Skills } from './styled';
import Typewriter from 'typewriter-effect';
import TextSpan from './TextSpan';
import { BrowserRouter, Link } from 'react-router-dom';



const Home = () => {

    const sentence = "Home".split("");
    const sentence2 = "Skills".split("");


    return (

        <div>

        <HomeContainer>
            <NavBar>
                <Name>Luis</Name>

                {/* <Name2>{texts[textIndex]}</Name2> */}
                <Name2>
                    <Typewriter
                        options={{
                            strings:["Gutiérrez", "Programmer"],
                            autoStart:true,
                            loop:true,
                        }}
                    />
                </Name2>

                <Container>
                    <BrowserRouter>


                    <Linkk to="/Home/">
                            {sentence2.map((letter,index)=>{

                                return(<TextSpan key={index}>{letter}</TextSpan>)
                            })}

                        </Linkk>

                        <Linkk to="/Skills/">
                            {sentence2.map((letter,index)=>{

                                return(<TextSpan key={index}>{letter}</TextSpan>)
                            })}

                        </Linkk>

                        <Skills>
                            About Me
                        </Skills>


                    </BrowserRouter>

                </Container>


            </NavBar>
            {/* <BasicExample></BasicExample> */}

        </HomeContainer>
        </div>
    )
}

export default Home
